import React from 'react';
import styled from "styled-components";

const COLORS = {
    primaryDark: "#115b4c",
    primaryLight: "B6EDC8",
}

const MenuLabel = styled.label`
background-color: ${COLORS.primaryDark};
position:fixed;
top: 12rem;
left: 5rem;
border-radius: 50%;
height: 7rem;
width: 7rem;
`;

const HamburgerMenu = () => {
    return (
        <>
            <MenuLabel htmlFor='navi-toggle'> Menu </MenuLabel>
        </>
    );
};

export default HamburgerMenu;
